    false,nt"url": null,nt"notes": "4-band aerial imagery was collected by
    Fugro Horizons using the Leica ADS40(SH52) camera with 30 percent side overlap on
    8/26/09. The flight height was 9,600 feet AMT(above mean terrain). The imagery was
    adjusted using Airborne GPS data. The imagery was used to create 4-band 25cm GSD
    (ground sample distance)georeferenced TIFF files based on DEM (Digital Elevation
    Model) data from 2008-2009 Red River LiDAR collect. Deliverables include NIR-RGB
    25cm pixel orthophotography, a flight index, and metadata (this file). The georeferenced
    files are based on UTM Zone14N NAD83 Meters'. The tiling scheme is based on 2000x2000
    meter tiles with a UTM naming convention. Horizons project# H09-0419.",nt"license_title":
